SELECT motos_2.anunciante_grupo AS anunciante_grupo,   MIN(motos_2.vehiculo) AS tempattrvehiculonk16626454430,   MIN(motos_2.vehiculo) AS tempattrvehiculonk5366548160,   motos_2.vehiculo AS vehiculo,   CAST(EXTRACT(MONTH FROM motos_2.fecha) AS LONG) AS mnfechaok,   SUM((CAST(motos_2.cols AS LONG) * CAST(motos_2.plgs AS LONG))) AS sumcalculation_1450626233922327ok,   SUM(CAST(motos_2.numanuncios AS LONG)) AS sumnumanunciosok FROM motos_2 WHERE ((motos_2.categoria IN ('CAMIONES', 'CAMIONES, BUSES Y PANELES', 'MOTOCICLETAS', 'PICK UPS, VANS Y JEEPS', 'PICK-UPS', 'SUV Y JEEPS', 'VEHICULOS NUEVOS')) AND (CAST(EXTRACT(YEAR FROM motos_2.fecha) AS LONG) >= 2010) AND (CAST(EXTRACT(YEAR FROM motos_2.fecha) AS LONG) <= 2015) AND (CAST(EXTRACT(YEAR FROM motos_2.fecha) AS LONG) = 2015) AND (motos_2.categoria = 'MOTOCICLETAS') AND (motos_2.medio = 'PRENSA')) GROUP BY motos_2.anunciante_grupo,   motos_2.vehiculo,   mnfechaok;
